import HomePage from './pages/home';
import SearchPage from './pages/search';
import PetDetailsPage from './pages/detail';
import PetDetailsNotFound from './pages/petDetailsNotFound';
import Root from './components/root';

// Add react-router-dom imports
import { Route, RouterProvider, createBrowserRouter, createRoutesFromElements } from 'react-router-dom';

// create router with JSX Route elements
const appRouter = createBrowserRouter(createRoutesFromElements(
<Route path="/" element={ <Root/> }>
  <Route index element />
<Route path="home" element={<HomePage/>}>
    <Route path="home/:type" element ={<HomePage/> }/>
    </Route>
<Route path="search" element={<SearchPage/>}/>
<Route path="detail" element={<PetDetailsPage/>}> 
    <Route path="detail/:type" element ={<PetDetailsPage/> }/>
    <Route path="detail/:id" element ={<PetDetailsPage/> }/>
    </Route>
<Route path="petdetailsnotfound" element={<PetDetailsNotFound/>}/>

</Route>
  ));

function App() {
  return (
    // replace below with a Router Provider
    <RouterProvider router = {appRouter}/>
  );
}

export default App;
